import Slider from "react-slick"
import CardItem from "./CardItems"
const CardsMovies = ({ title, movies }) => {
    return (
        <div>
            <h2>{title}</h2>
            {movies.map(movie =>
                <Slider>
                    <div>
                        <h1>{movie.title}</h1>
                        <img src={`https://image.tmdb.org/t/p/w300/${movies.poster_path}`} />

                    </div>
                </Slider>
            )}

        </div>

    )
}


export default CardsMovies
